import React from 'react';
import { createRoot } from 'react-dom/client'; // ✅ Use createRoot instead of ReactDOM.render
import App from './App';
import { BrowserRouter } from 'react-router-dom';

const root = createRoot(document.getElementById('root')); // ✅ createRoot instead of ReactDOM.render

root.render(
  <React.StrictMode>
    <BrowserRouter basename="/recanti">
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
